import React from 'react';
import { Navbar } from "react-bootstrap";
import { Nav } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';

import { useContext } from 'react';
import UserContext from './../context/UserContext';

function NavBar() { 

    const { userData, setUserData } = useContext(UserContext);

    const logout = () => {
        localStorage.removeItem('auth-token');
        setUserData({
            token: null,
            user: null
        });
    }

    return(
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand href="#home">Widget_Stic</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
            </Nav>
            <Nav>
                {
                userData.user ? (
                <>
                <Nav.Link eventKey={3} href="Light" class="profile" >
                    Profile {userData.user.username}    
                </Nav.Link>
                <Nav.Link eventKey={3} onClick={logout} href="/" class="logout"> 
                    Logout
                </Nav.Link>
                </>
                ) : (
                    <>
                <Nav.Link href="/Register">
                    Register
                </Nav.Link>
                <Nav.Link eventKey={2} href="/Login" bg="dark" >
                    Login
                </Nav.Link>
                </>
                )}
            </Nav>
        </Navbar.Collapse>
        </Navbar>
    );
}

export default NavBar
